t<br\/>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Review your website's third-party code and remove the ones that aren't adding any value to your website.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Debouncing your input handlers<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reducing JavaScript execution time<\/li>\n\t\t\t\t\t\t\t<li>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">Minify for JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Only using compositor properties<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">Minify for CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Only using compositor properties<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>"}}},"desktop":{"score":71,"first-contentful-paint":{"score":0.23,"displayValue":"2.2\u00a0s"},"largest-contentful-paint":{"score":0.47,"displayValue":"2.5\u00a0s"},"interactive":{"score":0.25,"displayValue":"6.1\u00a0s"},"cumulative-layout-shift":{"score":1,"displayValue":"0.009"},"total-blocking-time":{"score":0.98,"displayValue":"80\u00a0ms"},"speed-index":{"score":0.22,"displayValue":"3.2\u00a0s"},"screenshots":{"final":{"title":"Final Screenshot","screenshot":"data:image\/jpeg;base64,\/9j\/4AAQSkZJRgABAQAAAQABAAD\/2wBDAAYEBQYFBAYGBQYHBwYIChAKCgkJChQODwwQFxQYGBcUFhYaHSUfGhsjHBYWICwgIyYnKSopGR8tMC0oMCUoKSj\/2wBDAQcHBwoIChMKChMoGhYaKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCj\/wAARCAFcAfQDASIAAhEBAxEB\/8QAHQABAAIDAAMBAAAAAAAAAAAAAAIDAQQFBgcICf\/EAFQQAAEEAAQDBAQJCAUKBQMFAAEAAgMRBBIhMRNBUQUUImFScZGhBiMyVIGxwdHwCBUzNUJTkpMHQ2Jz4RYYJCVVY3KClLI3dNLj8SY0g1Z1laLC\/8QAGQEBAAMBAQAAAAAAAAAAAAAAAAECAwQF\/8QAKxEBAAIBAwIFAwQDAAAAAAAAAAECEQMSUQQTBRQhMaEVgeFBUlNxIkNh\/9oADAMBAAIRAxEAPwD5rjaHvALsoPNTMTQP0gPs+9aXGd0CcZ3QIN2SINaSJGurkCp93j1+Pb8oD6Oq5\\/SrVzj1U1YrFsUn0aLYnuBLWmgQCeQJUaN1RW6ztKdoaMxNFpNuPiy3v7fcss7TeyQObGwaAOq\\/Z96ZgYsdUsdVJuHldsw7X9CjwX0aF0LOqZgLHVLHVZdA9vygB9Kgxjn3lF0LKRORKx1Sx1WTC8bgCt9Rp5LD4ZGNtzaGvPoaUhY6pY6qQw0paXZPCAHE3y\/BTu0pdlDQTdaEb\/gII2OqWOqCGQsD8hyEXfLn9xUpcPLEQHsIJ280EbHVLHVRDHF4ZXiJqlZ3ab0OnPzr6wgjY6pY6qfdZraMnyrI13pY7vJlzAAjyI\\/Z3Vjo8Q42Y5SeuUrXjkfG7NG9zXdWmlZ3zE\/OJv