{"url":"https:\/\/actcentive.com\/wp-content\/plugins\/woocommerce-ajax-filters\/assets\/frontend\/css\/fullmain.min.css?x21992&ver=1.6.4.1","totalBytes":19943,"wastedPercent":99.97905923618563,"wastedBytes":19939},{"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/css\/item\/peepso-icons-new-v074d7df053611b62cd9308b185f737deb12a4daa.css?x21992","totalBytes":18136,"wastedBytes":18005,"wastedPercent":99.27925784966698},{"wastedBytes":10563,"wastedPercent":90.14531554034473,"totalBytes":11718,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/easy-social-share-buttons3\/assets\/css\/easy-social-share-buttons.min.css?x21992&ver=9.0"}],"type":["FCP","LCP"],"instructions":"<p>Some themes and plugins are loading CSS files or parts of the CSS files on all pages and not only on the pages that should be loading on. For eaxmple if you are using some contact form plugin, there is a chance that the CSS file of that plugin will load not only on the \/contact\/ page, but on all other pages as well and this is why the unused CSS should be removed.<\/p>\n\t\t\t\t\t\t<p>Open your Chrome browser, go to \u201cDeveloper Tools\u201d, click on \u201cMore Tools\u201d and then \u201cCoverage\u201d.<\/p>\n\t\t\t\t\t\t<p>Coverage will open up. We will see buttons for start capturing coverage, to reload and start capturing coverage and to stop capturing coverage and show results.<\/p>\n\t\t\t\t\t\t<p>If you have a webpage you want to analyze its code coverage. Load the webpage and click on the o button in the Coverage tab.<\/p>\n\t\t\t\t\t\t<p>After sometime, a table will show up in the tab with the resources it analyzed, and how much code is used in the webpage. All the files linked in the webpage (css, js) will be listed in the Coverage tab. Clicking on any resource there will open that resource in the Sources panel with a breakdown of Total Bytes and Unused Bytes.<\/p>\n\t\t\t\t\t\t<p>With this breakdown, we can see how many unused bytes are in our CSS files, so we can manually remove them.<\/p>"},"unminified-css":{"title":"Minify CSS","description":"Minifying CSS files can reduce network payload sizes. [Learn how to minify CSS](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unminified-css\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>On the <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\">Minify<\/a> tab all of the recommended settings are preset. Use the help button to simplify discovery of your CSS and JS files and groups. Pay close attention to the method and location of your JS group embeddings. See the plugin's <a target=\"_blank\" href=\"https:\/\/api.w3-edge.com\/v1\/redirects\/faq\/usage\">FAQs<\/a> for more information on usage.<\/p>"},"unminified-javascript":{"title":"Minify JavaScript","description":"Minifying JavaScript files can reduce payload sizes and script parse time. [Learn how to minify JavaScript](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unminified-javascript\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>On the <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\">Minify<\/a> tab all of the recommended settings are preset. Use the help button to simplify discovery of your CSS and JS files and groups. Pay close attention to the method and location of your JS group embeddings. See the plugin's <a target=\"_blank\" href=\"https:\/\/api.w3-edge.com\/v1\/redirects\/faq\/usage\">FAQs<\/a> for more information on usage.<\/p>"},"unused-javascript":{"title":"Reduce unused JavaScript","description":"Reduce unused JavaScript and defer loading scripts until they are required to decrease bytes consumed by network activity. [Learn how to reduce unused JavaScript](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unused-javascript\/).","score":0.38,"displayValue":"Potential savings of 349\u00a0KiB","details":[{"totalBytes":356458,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","wastedPercent":93.36887831915689,"wastedBytes":332821},{"totalBytes":36510,"wastedPercent":68.35167586200257,"wastedBytes":24955,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/head-4ff2b45e31395508c455df779edef601a979d4c5.js?x21992"}],"type":["LCP"],"instructions":"<p>Some themes and plugins are loading JS files or parts of the JS files on all pages and not only on the pages that should be loading on. For eaxmple if you are using some contact form plugin, there is a chance that the JS file of that plugin will load not only on the \/contact\/ page, but on all other pages as well and this is why the unused JS should be removed.<\/p>\n\t\t\t\t\t\t<p>Open your Chrome browser, go to \u201cDeveloper Tools\u201d, click on \u201cMore Tools\u201d and then \u201cCoverage\u201d.<\/p>\n\t\t\t\t\t\t<p>Coverage will open up. We will see buttons for start capturing coverage, to reload and start capturing coverage and to stop capturing coverage and show results.<\/p>\n\t\t\t\t\t\t<p>If you have a webpage you want to analyze its code coverage. Load the webpage and click on the o button in the Coverage tab.<\/p>\n\t\t\t\t\t\t<p>After sometime, a table will show up in the tab with the resources it analyzed, and how much code is used in the webpage. All the files linked in the webpage (css, js) will be listed in the Coverage tab. Clicking on any resource there will open that resource in the Sources panel with a breakdown of Total Bytes and Unused Bytes.<\/p>\n\t\t\t\t\t\t<p>With this breakdown, we can see how many unused bytes are in our JS files, so we can manually remove them.<\/p>"},"uses-responsive-images":{"title":"Properly size images","description":"Serve images that are appropriately-sized to save cellular data and improve load time. [Learn how to size images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-responsive-images\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>It's important to prepare images before uloading them to the website. This should be done before the Image is uploaded and can be done by using some image optimization tool like <a target=\"_blank\" href=\"https:\/\/helpx.adobe.com\/photoshop-elements\/using\/optimizing-images-jpeg-format.html\">photoshop<\/a>.<\/p>\n\t\t\t\t\t\t<p>Using srcset:<\/p>\n\t\t\t\t\t\t<p>The srcset HTML tag provides the browser with variations of an image (including a fallback image) and instructs the browser to use specific images depending on the situation.<\/p>\n\t\t\t\t\t\t<p>Essentially, you create various sizes of your image, and then utilize the srcset tag to define when the images get served. This is useful for responsive design when you have multiple images to deliver across\tseveral devices and dimensions.<\/p>\n\t\t\t\t\t\t<p>For example, let's say you want to send a high-resolution image to only those users that have high-resolution screens, as\tdetermined by the Device pixel ratio (DPR). The code would look like this:<\/p>\n\t\t\t\t\t\t<code><img srcset="large.jpg 2x, small.jpg 1x" src="small.jpg" alt="A single image"><\/code>\n\t\t\t\t\t\t<p>Use image optimization plugin.<\/p>"},"offscreen-images":{"title":"Defer offscreen images","description":"Consider lazy-loading offscreen and hidden images after all critical resources have finished loading to lower time to interactive. [Learn how to defer offscreen images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/offscreen-images\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>Enable lazy load for images.<\/p>"},"uses-optimized-images":{"title":"Efficiently encode images","description":"Optimized images load faster and consume less cellular data. [Learn how to efficiently encode images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-optimized-images\/).","score":1,