eight":229,"width":382}},"fromProtocol":true,"wastedBytes":93914.75,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/peepso-core\/assets\/images\/landing\/register-bg.jpg","totalBytes":173197,"isCrossOrigin":false,"wastedWebpBytes":72677}],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_extensions\" alt=\"W3TC Extensions\">Image Service<\/a> to convert media library images to WebP.<\/p>"},"uses-text-compression":{"title":"Enable text compression","description":"Text-based resources should be served with compression (gzip, deflate or brotli) to minimize total network bytes. [Learn more about text compression](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-text-compression\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>Use W3 Total Cache Browser Caching - Peformance>Browser Cache - Enable Gzip compression or Brotli compression (Gzip compression is most common and for Brotli compression you need to install <a target=\"_blank\" href=\"https:\/\/github.com\/kjdev\/php-ext-brotli\">Brotli extension<\/a> on your server.<\/p>"},"uses-rel-preconnect":{"title":"Preconnect to required origins","description":"Consider adding `preconnect` or `dns-prefetch` resource hints to establish early connections to important third-party origins. [Learn how to preconnect to required origins](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-rel-preconnect\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>Look at the list of third-party resources flagged by Google Page speed and add preconnect or dns-prefetch to their link tags depending on whether the resource is critical or not.<\/p>\n\t\t\t\t\t\t<ol>\n\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\tAdd preconnect for critical third-party domains. Out of the list of third-party resources flagged by Google Page speed, identify the critical third-party resources and add the following code to the link tag:\n\t\t\t\t\t\t\t\t<code><link rel="preconnect" target="_blank" href="https:\/\/third-party-example.com"><\/code>\n\t\t\t\t\t\t\t\tWhere "https:\/\/third-party-example.com" is the critical third-party domain your page intends to connect to.\n\t\t\t\t\t\t\t<\/li>\n\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\tAdd dns-prefetch for all other third-party domains. For all other third-party scripts, including non-critical ones, add the following code to the link tag:\n\t\t\t\t\t\t\t\t<code><link rel="dns-prefetch" target="_blank" href="https:\/\/third-party-example.com"><\/code>\n\t\t\t\t\t\t\t\tWhere "https:\/\/third-party-example.com"\tis the domain of the respective third-party resource.\n\t\t\t\t\t\t\t<\/li>\n\t\t\t\t\t\t<\/ol>"},"server-response-time":{"title":"Reduce initial server response time","description":"Keep the server response time for the main document short because all other requests depend on it. [Learn more about the Time to First Byte metric](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/time-to-first-byte\/).","score":0,"displayValue":"Root document took 2,200\u00a0ms","details":[{"responseTime":2197.955,"url":"https:\/\/actcentive.com\/"}],"type":["FCP","LCP"],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#page_cache\" alt=\"Page Cache\">Page Caching<\/a> (fastest module)<\/p>"},"redirects":{"title":"Avoid multiple page redirects","description":"Redirects introduce additional delays before the page can be loaded. [Learn how to avoid page redirects](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/redirects\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>When dealing with server-side redirects, we recommend that they be executed via web server configuration as they are often faster than application-level configuration.<\/p>\n\t\t\t\t\t\t<p>Avoid client-side redirects, as much as possible, as they are slower, non-cacheable and may not be supported by browsers by default.<\/p>\n\t\t\t\t\t\t<p>Wherever possible, avoid landing page redirects; especially, the practice of executing separate, individual redirects for reasons such as protocol change, adding www, mobile-specific page, geo-location, and subdomain.<\/p>\n\t\t\t\t\t\t<p>Always redirect to the preferred version of the URL, especially, when redirects are dynamically generated. This helps eliminate unnecessary redirects.<\/p>\n\t\t\t\t\t\t<p>Similarly, remove temporary redirects if not needed anymore.<\/p>\n\t\t\t\t\t\t<p>Remember that combining multiple redirects into a single redirect is the most effective way to improve web performance.<\/p>"},"uses-rel-preload":{"title":"Preload key requests","description":"Consider using `<link rel=preload>` to prioritize fetching resources that are currently requested later in page load. [Learn how to preload key requests](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-rel-preload\/).","score":null,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>JS and CSS - Use HTTP2\/Push for W3 Total Cache Minified files<\/p>\n\t\t\t\t\t\t<p>Preload fonts hosted on the server: <code><link rel="preload" target="_blank" href="fontname" as="font" type="font\/format" crossorigin><\/code><\/p>"},"efficient-animated-content":{"title":"Use video formats for animated content","description":"Large GIFs are inefficient for delivering animated content. Consider using MPEG4\/WebM videos for animations and PNG\/WebP for static images instead of GIF to save network bytes. [Learn more about efficient video formats](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/efficient-animated-content\/)","score":1,"displayValue":null,"details":[],"type":["LCP"],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_extensions\" alt=\"W3TC Extensions\">Image Service<\/a> to convert media library images to WebP.<\/p>"},"duplicated-javascript":{"title":"Remove duplicate modules in JavaScript bundles","description":"Remove large, duplicate JavaScript modules from bundles to reduce unnecessary bytes consumed by network activity. ","score":1,"displayValue":null,"details":[],"type":["TBT"],"instructions":"<p>Incorporate good site building practices into your development workflow to ensure you avoid duplication of JavaScript modules in the first place.<\/p>\n\t\t\t\t\t\t<p>To fix this audit, use a tool like <a target=\"_blank\" href=\"https:\/\/github.com\/zillow\/webpack-stats-duplicates\">webpack-stats-duplicates<\/a> to identify duplicate modules<\/p>"},"legacy-javascript":{"title":"Avoid serving legacy JavaScript to modern browsers","description":"Polyfills and transforms enable legacy browsers to use new JavaScript features. However, many aren't necessary for modern browsers. For your bundled JavaScript, adopt a modern script deployment strategy using module\/nomodule feature detection to reduce the amount of code shipped to modern browsers, while retaining support for legacy browsers. [Learn how to use modern JavaScript](https:\/\/web.dev\/publish-modern-javascript\/)","score":1,"displayValue":"Potential savings of 8\u00a0KiB","details":[{"wastedBytes":7782,"totalBytes":0,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","subItems":{"type":"subitems","items":[{"location":{"line":39,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","column":713,"type":"source-location","urlProvider":"network"},"signal":"Date.prototype.toISOString"},{"location":{"line":225,"column":2727,"urlProvider":"network","type":"source-location","url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992"},"signal":"@babel\/plugin-transform-classes"}]}}],"type":["TBT"],"instructions":"<p>One way to deal with this issue is to load polyfills, only when needed, which can provide feature-detection support at JavaScript runtime. However, it is often very difficult to implement in practice.<\/p>\n\t\t\t\t\t\t<p>Implement modern feature-detection using <code><script type="module"><\/code> and <code><script nomodule><\/code>.<\/p>\n\t\t\t\t\t\t<p>Every browser that supports <code><script type="module"><\/code> also supports most of the ES6 features. This lets you load regular JavaScript files with ES6 features, knowing that the browser can handle it.<\/p>\n\t\t\t\t\t\t<p>For browsers that don't support <code><script type="module"><\/code> you can use the translated ES5 code instead. In this manner, you are always serving modern code to modern browsers.<\/p>\n\t\t\t\t\t\t<p>Learn more about implementing this technique <a target=\"_blank\" href=\"https:\/\/philipwalton.com\/articles\/deploying-es2015-code-in-production-today\/\">here<\/a>.<\/p>"},"preload-lcp-image":{"title":null,"description":null,"score":null,"displayValue":null,"details":null,"type":["LCP"],"instructions":"<p>Enable lazy load for images.<\/p>"},"total-byte-weight":{"title":"Avoids enormous network payloads","description":"Large network payloads cost users real money and are highly correlated with long load times. [Learn how to reduce payload sizes](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/total-byte-weight\/).","score":1,"displayValue":"Total size was 1,504\u00a0KiB","details":[{"url":"https:\/\/actcentive.com\/wp-includes\/js\/zxcvbn.min.js","totalBytes":397029},{"totalBytes":356458,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992"},{"url":"https:\/\/actcentive.com\/wp-content\/plugins\/peepso-core\/assets\/images\/landing\/register-bg.jpg","totalBytes":173603},{"totalBytes":125322,"url":"https:\/\/actcentive.com\/wp-content\