el":"Other","duration":1048.9879999999926},{"group":"scriptEvaluation","duration":798.6519999999997,"groupLabel":"Script Evaluation"},{"group":"styleLayout","duration":686.4960000000001,"groupLabel":"Style & Layout"},{"duration":226.48399999999995,"group":"parseHTML","groupLabel":"Parse HTML & CSS"},{"group":"paintCompositeRender","duration":214.01999999999757,"groupLabel":"Rendering"},{"groupLabel":"Script Parsing & Compilation","duration":189.59999999999997,"group":"scriptParseCompile"}],"type":["TBT"],"instructions":"<p>Optimizing third-party JavaScript<\/p>\n\t\t\t\t\t\t<p>Review your website's third-party code and remove the ones\tthat aren't adding any value to your website.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/web.dev\/debounce-your-input-handlers\/\">Debouncing your input handlers<\/a><\/p>\n\t\t\t\t\t\t<p>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/p>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<p>Reducing JavaScript execution time<\/p>\n\t\t\t\t\t\t<p>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<p>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/p>"},"third-party-summary":{"title":"Minimize third-party usage","description":"Third-party code can significantly impact load performance. Limit the number of redundant third-party providers and try to load third-party code after your page has primarily finished loading. [Learn how to minimize third-party impact](https:\/\/developers.google.com\/web\/fundamentals\/performance\/optimizing-content-efficiency\/loading-third-party-javascript\/).","score":null,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<ol>\n\t\t\t\t\t\t\t<li>Find Slow Third-Party-Code<\/li>\n\t\t\t\t\t\t\t<li>Lazy Load YouTube Videos<\/li>\n\t\t\t\t\t\t\t<li>Host Google Fonts Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Google Analytics Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Facebook Pixel Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Gravatars Locally<\/li>\n\t\t\t\t\t\t\t<li>Delay Third-Party JavaScript<\/li>\n\t\t\t\t\t\t\t<li>Defer Parsing Of JavaScript<\/li>\n\t\t\t\t\t\t\t<li>Prefetch Or Preconnect Third-Party Scripts<\/li>\n\t\t\t\t\t\t\t<li>Avoid Google AdSense And Maps<\/li>\n\t\t\t\t\t\t\t<li>Don't Overtrack In Google Tag Manager<\/li>\n\t\t\t\t\t\t\t<li>Replace Embeds With Screenshots<\/li>\n\t\t\t\t\t\t\t<li>Use A Lightweight Social Sharing Plugin<\/li>\n\t\t\t\t\t\t\t<li>Use Cloudflare Workers<\/li>\n\t\t\t\t\t\t<\/ol>"},"third-party-facades":{"title":"Lazy load third-party resources with facades","description":"Some third-party embeds can be lazy loaded. Consider replacing them with a facade until they are required. [Learn how to defer third-parties with a facade](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/third-party-facades\/).","score":null,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<p>Preload - Lazyload embeded videos.<\/p>"},"lcp-lazy-loaded":{"title":"Largest Contentful Paint image was not lazily loaded","description":"Above-the-fold images that are lazily loaded render later in the page lifecycle, which can delay the largest contentful paint. [Learn more about optimal lazy loading](https:\/\/web.dev\/lcp-lazy-loading\/).","score":1,"displayValue":null,"details":[{"node":{"snippet":"<div class=\"ps-landing__cover\" style=\"background-image: url("\/wp-content\/plugins\/peepso-core\/assets\/images\/landin\u2026");\">","selector":"div.ps-page > div.ps-landing > div.ps-lading__inner > div.ps-landing__cover","type":"node","lhId":"1-9-DIV","boundingRect":{"right":397,"top":587,"width":382,"left":15,"height":229,"bottom":816},"path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,0,DIV","nodeLabel":"Get Connected!\nCome and join our Actcentive community. Expand your network and \u2026"}}],"instructions":"<p>Don't lazy load images that appear "above the fold" just use a standard <img> or <picture>\telement.<\/p>\n\t\t\t\t\t\t<p>Exclude the image from being lazy-loaded if the W3 Total Cache Lazy load is enabled in Performance Â» User Experience Â» Exclude words.<\/p>"},"uses-passive-event-listeners":{"title":"Uses passive listeners to improve scrolling performance","description":"Consider marking your touch and wheel event listeners as `passive` to improve your page's scroll performance. [Learn more about adopting passive event listeners](https:\/\/developer.chrome.com\/docs\/lighthouse\/best-practices\/uses-passive-event-listeners\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>Add a passive flag to every event listener that Lighthouse identified.<\/p>\n\t\t\t\t\t\t<p>If you're only supporting browsers that have passive event listener support, just add the flag.<\/p>\n\t\t\t\t\t\t<p>For example:<\/p>\n\t\t\t\t\t\t<code>document.addEventListener("touchstart", onTouchStart, {passive: true});<\/code>\n\t\t\t\t\t\t<p>If you're supporting older browsers that don't support passive event listeners, you'll need to use feature detection or a polyfill. See the Feature Detection section of the WICG Passive event listeners explainer document for more information.<\/p>"},"no-document-write":{"title":"Avoids `document.write()`","description":"For users on slow connections, external scripts dynamically injected via `document.write()` can delay page load by tens of seconds. [Learn how to avoid document.write()](https:\/\/developer.chrome.com\/docs\/lighthouse\/best-practices\/no-document-write\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>You can fix this audit by preferably eliminating document.write() altogether, wherever possible.<\/p>\n\t\t\t\t\t\t<p>Avoiding the use of document.write() should ideally be built into your development workflow so that your production website is optimized for web performance from the beginning.<\/p>\n\t\t\t\t\t\t<p>Using W3 Total Cache JS Minify and deferring or using async may also help.<\/p>"},"non-composited-animations":{"title":"Avoid non-composited animations","description":"Animations which are not composited can be janky and increase CLS. [Learn how to avoid non-composited animations](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/non-composited-animations\/)","score":null,"displayValue":"1 animated element found","details":[{"node":{"snippet":"<div class=\"ps-post__placeholder\">","boundingRect":{"width":342,"bottom":1243,"left":35,"right":377,"top":1147,"height":96},"selector":"div.ps-activity__container > div#ps-activitystream-loading > div.ps-post > div.ps-post__placeholder","path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,1,DIV,0,DIV,2,DIV,0,DIV,0,DIV","type":"node","lhId":"page-6-DIV","nodeLabel":"div.ps-activity__container > div#ps-activitystream-loading > div.ps-post > div.ps-post__placeholder"},"subItems":{"items":[{"animation":"placeHolderShimmer","failureReason":"Unsupported CSS Properties: background-position-x, background-position-y"}],"type":"subitems"}}],"type":["CLS"],"instructions":"<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties:<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/p>"},"unsized-images":{"title":"Image elements have explicit `width` and `height`","description":"Set an explicit width and height on image elements to reduce layout shifts and improve CLS. [Learn how to set image dimensions](https:\/\/web.dev\/optimize-cls\/#images-without-dimensions)","score":1,"displayValue":null,"details":[],"type":["CLS"],"instructions":"<p>To fix this audit, simply specify, both, the width and height for your webpage's image and video elements. This ensures that the correct spacing is used for images and videos.<\/p>\n\t\t\t\t\t\t<p>For example:<\/p>\n\t\t\t\t\t\t<code><img src="image.jpg" width="640" height="360" alt="image"><\/code>\n\t\t\t\t\t\t<p>Where width and height have been declared as 640 and 360 pixels respectively.<\/p>\n\t\t\t\t\t\t<p>Note that modern browsers automatically calculate the aspect ratio for an image\/video based on the declared width and height attributes.<\/p>"},"viewport":{"title":"Has a `<meta name=\"viewport\">` t