nline critical CSS.<\/li>\n\t\t\t\t\t\t\t<li>Minify and compress JavaScript files.<\/li>\n\t\t\t\t\t\t\t<li>Defer unused JavaScript.<\/li>\n\t\t\t\t\t\t\t<li>Minimize unused polyfills.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is resource load times:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Optimize and compress images.<\/li>\n\t\t\t\t\t\t\t<li>Preload important resources.<\/li>\n\t\t\t\t\t\t\t<li>Compress text files.<\/li>\n\t\t\t\t\t\t\t<li>Deliver different assets based on the network connection (adaptive serving).<\/li>\n\t\t\t\t\t\t\t<li>Cache assets using a service worker.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is client-side rendering:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Minimize critical JavaScript.<\/li>\n\t\t\t\t\t\t\t<li>Use another rendering strategy.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>W3 Total Cache Features that will help performace of the above:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#minify\" alt=\"Minify\">Minify<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#page_cache\" alt=\"Page Cache\">Page Cache<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#browser_cache\" alt=\"Browser Cache\">Browser Cache<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a><\/li>\n\t\t\t\t\t\t<\/ul>"},"layout-shift-elements":{"title":"Avoid large layout shifts","description":"These DOM elements contribute most to the CLS of the page. [Learn how to improve CLS](https:\/\/web.dev\/optimize-cls\/)","score":null,"displayValue":"5 elements found","details":[{"score":0.28170085887035456,"node":{"snippet":"<div id=\"content\" class=\"large-9 rig