o button in the Coverage tab.<\/p>\n\t\t\t\t\t\t<p>After sometime, a table will show up in the tab with the resources it analyzed, and how much code is used in the webpage. All the files linked in the webpage (css, js) will be listed in the Coverage tab. Clicking on any resource there will open that resource in the Sources panel with a breakdown of Total Bytes and Unused Bytes.<\/p>\n\t\t\t\t\t\t<p>With this breakdown, we can see how many unused bytes are in our CSS files, so we can manually remove them.<\/p>"},"unminified-css":{"title":"Minify CSS","description":"Minifying CSS files can reduce network payload sizes. [Learn how to minify CSS](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unminified-css\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>On the <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\">Minify<\/a> tab all of the recommended settings are preset. Use the help button to simplify discovery of your CSS and JS files and groups. Pay close attention to the method and location of your JS group embeddings. See the plugin's <a target=\"_blank\" href=\"https:\/\/api.w3-edge.com\/v1\/redirects\/faq\/usage\">FAQs<\/a> for more information on usage.<\/p>"},"unminified-javascript":{"title":"Minify JavaScript","description":"Minifying JavaScript files can reduce payload sizes and script parse time. [Learn how to minify JavaScript](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unminified-javascript\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>On the <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\">Minify<\/a> tab all of the recommended settings are preset. Use the help button to simplify discovery of your CSS and JS files and groups. Pay close attention to the method and location of your JS group embeddings. See the plugin's <a target=\"_blank\" href=\"https:\/\/api.w3-edge.com\/v1\/redirects\/faq\/usage\">FAQs<\/a> for more information on usage.<\/p>"},"unused-javascript":{"title":"Reduce unused JavaScript","description":"Reduce unused JavaScript and defer loading scripts until they are required to decrease bytes consumed by network activity. [Learn how to reduce unused JavaScript](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/unused-javascript\/).","score":0.8,"displayValue":"Potential savings of 349\u00a0KiB","details":[{"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","wastedPercent":93.36887831915689,"wastedBytes":332828,"totalBytes":356466},{"totalBytes":36533,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/head-4ff2b45e31395508c455df779edef601a979d4c5.js?x21992","wastedPercent":68.35167586200257,"wastedBytes":24971}],"type":["LCP"],"instructions":"<p>Some themes and plugins are loading JS files or parts of the JS files on all pages and not only on the pages that should be loading on. For eaxmple if you are using some contact form plugin, there is a chance that the JS file of that plugin will load not only on the \/contact\/ page, but on all other pages as well and this is why the unused JS should be removed.<\/p>\n\t\t\t\t\t\t<p>Open your Chrome browser, go to \u201cDeveloper Tools\u201d, click on \u201cMore Tools\u201d and then \u201cCoverage\u201d.<\/p>\n\t\t\t\t\t\t<p>Coverage will open up. We will see buttons for start capturing coverage, to reload and start capturing coverage and to stop capturing coverage and show results.<\/p>\n\t\t\t\t\t\t<p>If you have a webpage you want to analyze its code coverage. Load the webpage and click on the o button in the Coverage tab.<\/p>\n\t\t\t\t\t\t<p>After sometime, a table will show up in the tab with the resources it analyzed, and how much code is used in the webpage. All the files linked in the webpage (css, js) will be listed in the Coverage tab. Clicking on any resource there will open that resource in the Sources panel with a breakdown of Total Bytes and Unused Bytes.<\/p>\n\t\t\t\t\t\t<p>With this breakdown, we can see how many unused bytes are in our JS files, so we can manually remove them.<\/p>"},"uses-responsive-images":{"title":"Properly size images","description":"Serve images that are appropriately-sized to save cellular data and improve load time. [Learn how to size images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-responsive-images\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>It's important to prepare images before uloading them to the website. This should be done before the Image is uploaded and can be done by using some image optimization tool like <a target=\"_blank\" href=\"https:\/\/helpx.adobe.com\/photoshop-elements\/using\/optimizing-images-jpeg-format.html\">photoshop<\/a>.<\/p>\n\t\t\t\t\t\t<p>Using srcset:<\/p>\n\t\t\t\t\t\t<p>The srcset HTML tag provides the browser with variations of an image (including a fallback image) and instructs the browser to use specific images depending on the situation.<\/p>\n\t\t\t\t\t\t<p>Essentially, you create various sizes of your image, and then utilize the srcset tag to define when the images get served. This is useful for responsive design when you have multiple images to deliver across\tseveral devices and dimensions.<\/p>\n\t\t\t\t\t\t<p>For example, let's say you want to send a high-resolution image to only those users that have high-resolution screens, as\tdetermined by the Device pixel ratio (DPR). The code would look like this:<\/p>\n\t\t\t\t\t\t<code><img srcset="large.jpg 2x, small.jpg 1x" src="small.jpg" alt="A single image"><\/code>\n\t\t\t\t\t\t<p>Use image optimization plugin.<\/p>"},"offscreen-images":{"title":"Defer offscreen images","description":"Consider lazy-loading offscreen and hidden images after all critical resources have finished loading to lower time to interactive. [Learn how to defer offscreen images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/offscreen-images\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>Enable lazy load for images.<\/p>"},"uses-optimized-images":{"title":"Efficiently encode images","description":"Optimized images load faster and consume less cellular data. [Learn how to efficiently encode images](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-optimized-images\/).","score":1,"displayValue":"Potential savings of 17\u00a0KiB","details":[{"isCrossOrigin":false,"node":{"snippet":"<div class=\"ps-landing__cover\" style=\"background-image: url("\/wp-content\/plugins\/peepso-core\/assets\/images\/landin\u2026");\">","nodeLabel":"Get Connected!\nCome and join our Actcentive community. Expand your network and \u2026","path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,0,DIV","lhId":"1-9-DIV","type":"node","selector":"div.ps-page > div.ps-landing > div.ps-lading__inner > div.ps-landing__cover","boundingRect":{"width":983,"bottom":639,"height":393,"left":353,"top":246,"right":1335}},"totalBytes":173197,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/peepso-core\/assets\/images\/landing\/register-bg.jpg","fromProtocol":true,"wastedBytes":16900}],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_extensions\" alt=\"W3TC Extensions\">Image Service<\/a> to convert media library images to WebP.<\/p>"},"modern-image-formats":{"title":"Serve images in next-gen formats","description":"Image formats like WebP and AVIF often provide better compression than PNG or JPEG, which means faster downloads and less data consumption. [Learn more about modern image formats](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-webp-images\/).","score":0.93,"displayValue":"Potential savings of 92\u00a0KiB","details":[{"wastedWebpBytes":72677,"totalBytes":173197,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/peepso-core\/assets\/images\/landing\/register-bg.jpg","isCrossOrigin":false,"fromProtocol":true,"node":{"snippet":"<div class=\"ps-landing__cover\" style=\"background-image: url("\/wp-content\/plugins\/peepso-core\/assets\/images\/landin\u2026");\">","lhId":"1-9-DIV","selector":"div.ps-page > div.ps-landing > div.ps-lading__inner > div.ps-landing__cover","nodeLabel":"Get Connected!\nCome and join our Actcentive community. Expand your network and \u2026","path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,0,DIV","type":"node","boundingRect":{"right":1335,"top":246,"left":353,"bottom":639,"width":983,"height":393}},"wastedBytes":93914.75}],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_extensions\" alt=\"W3TC Extensions\">Image Service<\/a> to convert media library images to WebP.<\/p>"},"uses-text-compression":{"title":"Enable text compression","description":"Text-based resources should be served with compression (gzip, deflate or brotli) to minimize total network bytes. [Learn more about text compression](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-text-compression\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>Use W3 Total Cache Browser Caching - Peformance>Browser Cache - Enable Gzip compression or Brotli compression (Gzip compression is most common and for Brotli compression you need to install <a target=\"_blank\" href=\"https:\/\/github.com\/kjdev\/php-ext-brotli\">Brotli extension<\/a> on your server.<\/p>"},"uses-rel-preconnect":{"title":"Preconnect to required origins","description":"Consider adding `preconnect` or `dns-prefetch` resource hints to establish early connections to important third-party origins. [Learn how to preconnect to required origins](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-rel-preconnect\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>Look at the list of third-party resources flagged by Google Page speed and add preconnect or dns-prefetch to their link tags depending on whether the resource is critical or not.<\/p>\n\t\t\t\t\t\t<ol>\n\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\tAdd preconnect for critical third-party domains. Out of the list of third-party resources flagged by Google Page speed, identify the critical third-party resources and add the following code to the link tag:\n\t\t\t\t\t\t\t\t<code><link rel="preconnect" target="_blank" href="https:\/\/third-party-example.com"><\/code>\n\t\t\t\t\t\t\t\tWhere "https:\/\/third-party-example.com" is the critical third-party domain your page intends to connect to.\n\t\t\t\t\t\t\t<\/li>\n\t\t\t\t\t\t\t<li>\n\t\t\t\t\t\t\t\tAdd dns-prefetch for all other third-party domains. For all other third-party scripts, including non-critical ones, add the following code to the link tag:\n\t\t\t\t\t\t\t\t<code><link rel="dns-prefetch" target="_blank" href="https:\/\/third-party-example.com"><\/code>\n\t\t\t\t\t\t\t\tWhere "https:\/\/third-party-example.com"\tis the domain of the respective third-party resource.\n\t\t\t\t\t\t\t<\/li>\n\t\t\t\t\t\t<\/ol>"},"server-response-time":{"title":"Initial server response time was short","description":"Keep the server response time for the main document short because all other requests depend on it. [Learn more about the Time to First Byte metric](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/time-to-first-byte\/).","score":1,"displayValue":"Root document took 70\u00a0ms","details":[{"responseTime":65.944,"url":"https:\/\/actcentive.com\/"}],"type":["FCP","LCP"],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#page_cache\" alt=\"Page Cache\">Page Caching<\/a> (fastest module)<\/p>"},"redirects":{"title":"Avoid multiple page redirects","description":"Redirects introduce additional delays before the page can be loaded. [Learn how to avoid page redirects](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/redirects\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>When dealing with server-side redirects, we recommend that they be executed via web server configuration as they are often faster than application-level configuration.<\/p>\n\t\t\t\t\t\t<p>Avoid client-side redirects, as much as possible, as they are slower, non-cacheable and may not be supported by browsers by default.<\/p>\n\t\t\t\t\t\t<p>Wherever possible, avoid landing page redirects; especially, the practice of executing separate, individual redirects for reasons such as protocol change, adding www, mobile-specific page, geo-location, and subdomain.<\/p>\n\t\t\t\t\t\t<p>Always redirect to the preferred version of the URL, especially, when redirects are dynamically generated. This helps eliminate unnecessary redirects.<\/p>\n\t\t\t\t\t\t<p>Similarly, remove temporary redirects if not needed anymore.<\/p>\n\t\t\t\t\t\t<p>Remember that combining multiple redirects into a single redirect is the most effective way to improve web performance.<\/p>"},"uses-rel-preload":{"title":"Preload key requests","description":"Consider using `<link rel=preload>` to prioritize fetching resources that are currently requested later in page load. [Learn how to preload key requests](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-rel-preload\/).","score":null,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>JS and CSS - Use HTTP2\/Push for W3 Total Cache Minified files<\/p>\n\t\t\t\t\t\t<p>Preload fonts hosted on the server: <code><link rel="preload" target="_blank" href="fontname" as="font" type="font\/format" crossorigin><\/code><\/p>"},"efficient-animated-content":{"title":"Use video formats for animated content","description":"Large GIFs are inefficient for delivering animated content. Consider using MPEG4\/WebM videos for animations and PNG\/WebP for static images instead of GIF to save network bytes. [Learn more about efficient video formats](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/efficient-animated-content\/)","score":1,"displayValue":null,"details":[],"type":["LCP"],"instructions":"<p>Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_extensions\" alt=\"W3TC Extensions\">Image Service<\/a> to convert media library images to WebP.<\/p>"},"duplicated-javascript":{"title":"Remove duplicate modules in JavaScript bundles","description":"Remove large, duplicate JavaScript modules from bundles to reduce unnecessary bytes consumed by network activity. ","score":1,"displayValue":null,"details":[],"type":["TBT"],"instructions":"<p>Incorporate good site building practices into your development workflow to ensure you avoid duplication of JavaScript modules in the first place.<\/p>\n\t\t\t\t\t\t<p>To fix this audit, use a tool like <a target=\"_blank\" href=\"https:\/\/github.com\/zillow\/webpack-stats-duplicates\">webpack-stats-duplicates<\/a> to identify duplicate modules<\/p>"},"legacy-javascript":{"title":"Avoid serving legacy JavaScript to modern browsers","description":"Polyfills and transforms enable legacy browsers to use new JavaScript features. However, many aren't necessary for modern browsers. For your bundled JavaScript, adopt a modern script deployment strategy using module\/nomodule feature detection to reduce the amount of code shipped to modern browsers, while retaining support for legacy browsers. [Learn how to use modern JavaScript](https:\/\/web.dev\/publish-modern-javascript\/)","score":1,"displayValue":"Potential savings of 8\u00a0KiB","details":[{"subItems":{"items":[{"location":{"column":713,"line":39,"type":"source-location","urlProvider":"network","url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992"},"signal":"Date.prototype.toISOString"},{"signal":"@babel\/plugin-transform-classes","location":{"column":2727,"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","line":225,"urlProvider":"network","type":"source-location"}}],"type":"subitems"},"url":"https:\/\/actcentive.com\/wp-content\/cache\/asset-cleanup\/js\/body-5404a607cce5fbf2143f321f1abac10a48959abf.js?x21992","wastedBytes":7782,"totalBytes":0}],"type":["TBT"],"instructions":"<p>One way to deal with this issue is to load polyfills, only when needed, which can provide feature-detection support at JavaScript runtime. However, it is often very difficult to implement in practice.<\/p>\n\t\t\t\t\t\t<p>Implement modern feature-detection using <code><script type="module"><\/code> and <code><script nomodule><\/code>.<\/p>\n\t\t\t\t\t\t<p>Every browser that supports <code><script type="module"><\/code> also supports most of the ES6 features. This lets you load regular JavaScript files with ES6 features, knowing that the browser can handle it.<\/p>\n\t\t\t\t\t\t<p>For browsers that don't support <code><script type="module"><\/code> you can use the translated ES5 code instead. In this manner, you are always serving modern code to modern browsers.<\/p>\n\t\t\t\t\t\t<p>Learn more about implementing this technique <a target=\"_blank\" href=\"https:\/\/philipwalton.com\/articles\/deploying-es2015-code-in-production-today\/\">here<\/a>.<\/p>"},"preload-lcp-image":{"title":null,"description":null,"score":null,"displayValue":null,"details":null,"type":["LCP"],"instructions":"<p>Enable lazy load for images.<\/p>"},"total-byte-weight":{"title":"Avoids enormous network payloads","description":"Large network payloads cost users real money and are highly correlated with long load times. [Learn how to reduce payload sizes](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/total-byte-weight\/).","score":1,"d