<\/p>"},"bootup-time":{"title":"JavaScript execution time","description":"Consider reducing the time spent parsing, compiling, and executing JS. You may find delivering smaller JS payloads helps with this. [Learn how to reduce Javascript execution time](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/bootup-time\/).","score":1,"displayValue":"0.2\u00a0s","details":[{"total":487.48399999999907,"scriptParseCompile":7.3210000000000015,"url":"https:\/\/actcentive.com\/","scripting":50.56200000000001},{"url":"https:\/\/actcentive.com\/wp-includes\/js\/zxcvbn.min.js","scriptParseCompile":13.693,"scripting":92.72000000000001,"total":106.57800000000002},{"scriptParseCompile":0,"scripting":1.78,"url":"Unattributable","total":53.96400000000002}],"type":["TBT"],"instructions":"<p>On the <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\">Minify<\/a> tab all of the recommended settings are preset. Use the help button to simplify discovery of your CSS and JS files and groups. Pay close attention to the method and location of your JS group embeddings. See the plugin's <a target=\"_blank\" href=\"https:\/\/api.w3-edge.com\/v1\/redirects\/faq\/usage\">FAQs<\/a> for more information on usage.<\/p>"},"mainthread-work-breakdown":{"title":"Minimizes main-thread work","description":"Consider reducing the time spent parsing, compiling and executing JS. You may find delivering smaller JS payloads helps with this. [Learn how to minimize main-thread work](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/mainthread-work-breakdown\/)","score":1,"displayValue":"0.8\u00a0s","details":[{"group":"other","groupLabel":"Other","duration":241.055999999998},{"group":"styleLayout","duration":201.86700000000013,"groupLabel":"Style & Layout"},{"group":"scriptEvaluation","duration":185.5200000000001,"groupLabel":"Script Evaluation"},{"duration":61.884000000000015,"group":"parseHTML","groupLabel":"Parse HTML & CSS"},{"duration":56.13099999999937,"group":"paintCompositeRender","groupLabel":"Rendering"},{"duration":48.749,"groupLabel":"Script Parsing & Compilation","group":"scriptParseCompile"}],"type":["TBT"],"instructions":"<p>Optimizing third-party JavaScript<\/p>\n\t\t\t\t\t\t<p>Review your website's third-party code and remove the ones\tthat aren't adding any value to your website.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/web.dev\/debounce-your-input-handlers\/\">Debouncing your input handlers<\/a><\/p>\n\t\t\t\t\t\t<p>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/p>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<p>Reducing JavaScript execution time<\/p>\n\t\t\t\t\t\t<p>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<p>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache Minify for <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/p>\n\t\t\t\t\t\t<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/p>"},"third-party-summary":{"title":"Minimize third-party usage","description":"Third-party code can significantly impact load performance. Limit the number of redundant third-party providers and try to load third-party code after your page has primarily finished loading. [Learn how to minimize third-party impact](https:\/\/developers.google.com\/web\/fundamentals\/performance\/optimizing-content-efficiency\/loading-third-party-javascript\/).","score":null,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<ol>\n\t\t\t\t\t\t\t<li>Find Slow Third-Party-Code<\/li>\n\t\t\t\t\t\t\t<li>Lazy Load YouTube Videos<\/li>\n\t\t\t\t\t\t\t<li>Host Google Fonts Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Google Analytics Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Facebook Pixel Locally<\/li>\n\t\t\t\t\t\t\t<li>Host Gravatars Locally<\/li>\n\t\t\t\t\t\t\t<li>Delay Third-Party JavaScript<\/li>\n\t\t\t\t\t\t\t<li>Defer Parsing Of JavaScript<\/li>\n\t\t\t\t\t\t\t<li>Prefetch Or Preconnect Third-Party Scripts<\/li>\n\t\t\t\t\t\t\t<li>Avoid Google AdSense And Maps<\/li>\n\t\t\t\t\t\t\t<li>Don't Overtrack In Google Tag Manager<\/li>\n\t\t\t\t\t\t\t<li>Replace Embeds With Screenshots<\/li>\n\t\t\t\t\t\t\t<li>Use A Lightweight Social Sharing Plugin<\/li>\n\t\t\t\t\t\t\t<li>Use Cloudflare Workers<\/li>\n\t\t\t\t\t\t<\/ol>"},"third-party-facades":{"title":"Lazy load third-party resources with facades","description":"Some third-party embeds can be lazy loaded. Consider replacing them with a facade until they are required. [Learn how to defer third-parties with a facade](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/third-party-facades\/).","score":null,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<p>Preload - Lazyload embeded videos.<\/p>"},"lcp-lazy-loaded":{"title":"Largest Contentful Paint image was not lazily loaded","description":"Above-the-fold images that are lazily loaded render later in the page lifecycle, which can delay the largest contentful paint. [Learn more about optimal lazy loading](https:\/\/web.dev\/lcp-lazy-loading\/).","score":1,"displayValue":null,"details":[{"node":{"lhId":"1-9-DIV","path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,0,DIV","snippet":"<div class=\"ps-landing__cover\" style=\"background-image: url("\/wp-content\/plugins\/peepso-core\/assets\/images\/landin\u2026");\">","boundingRect":{"width":983,"top":246,"right":1335,"height":393,"bottom":639,"left":353},"nodeLabel":"Get Connected!\nCome and join our Actcentive community. Expand your network and \u2026","selector":"div.ps-page > div.ps-landing > div.ps-lading__inner > div.ps-landing__cover","type":"node"}}],"instructions":"<p>Don't lazy load images that appear "above the fold" just use a standard <img> or <picture>\telement.<\/p>\n\t\t\t\t\t\t<p>Exclude the image from being lazy-loaded if the W3 Total Cache Lazy load is enabled in Performance Â» User Experience Â» Exclude words.<\/p>"},"uses-passive-event-listeners":{"title":"Uses passive listeners to improve scrolling performance","description":"Consider marking your touch and wheel event listeners as `passive` to improve your page's scroll performance. [Learn more about adopting passive event listeners](https:\/\/developer.chrome.com\/docs\/lighthouse\/best-practices\/uses-passive-event-listeners\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>Add a passive flag to every event listener that Lighthouse identified.<\/p>\n\t\t\t\t\t\t<p>If you're only supporting browsers that have passive event listener support, just add the flag.<\/p>\n\t\t\t\t\t\t<p>For example:<\/p>\n\t\t\t\t\t\t<code>document.addEventListener("touchstart", onTouchStart, {passive: true});<\/code>\n\t\t\t\t\t\t<p>If you're supporting older browsers that don't support passive event listeners, you'll need to use feature detection or a polyfill. See the Feature Detection section of the WICG Passive event listeners explainer document for more information.<\/p>"},"no-document-write":{"title":"Avoids `document.write()`","description":"For users on slow connections, external scripts dynamically injected via `document.write()` can delay page load by tens of seconds. [Learn how to avoid document.write()](https:\/\/developer.chrome.com\/docs\/lighthouse\/best-practices\/no-document-write\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>You can fix this audit by preferably eliminating document.write() altogether, wherever possible.<\/p>\n\t\t\t\t\t\t<p>Avoiding the use of document.write() should ideally be built into your development workflow so that your production website is optimized for web performance from the beginning.<\/p>\n\t\t\t\t\t\t<p>Using W3 Total Cache JS Minify and deferring or using async may also help.<\/p>"},"non-composited-animations":{"title":"Avoid non-composited animations","description":"Animations which are not composited can be janky and increase CLS. [Learn how to avoid non-composited animations](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/non-composited-animations\/)","score":null,"displayValue":"1 animated element found","details":[{"node":{"path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,1,DIV,0,DIV,2,DIV,0,DIV,0,DIV","selector":"div.ps-activity__container > div#ps-activitystream-loading > div.ps-post > div.ps-post__placeholder","type":"node","boundingRect":{"width":943,"bottom":936,"height":96,"top":840,"right":1315,"left":373},"snippet":"<div class=\"ps-post__placeholder\">","lhId":"page-2-DIV","nodeLabel":"div.ps-activity__container > div#ps-activitystream-loading > div.ps-post > div.ps-post__placeholder"},"subItems":{"items":[{"failureReason":"Unsupported CSS Properties: background-position-x, background-position-y","animation":"placeHolderShimmer"}],"type":"subitems"}}],"type":["CLS"],"instructions":"<p><a target=\"_blank\" href=\"https:\/\/developers.google.com\/web\/fundamentals\/performance\/rendering\/stick-to-compositor-only-properties-and-manage-layer-count\">Only using compositor properties:<\/a><\/p>\n\t\t\t\t\t\t<p>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/p>"},"unsized-images":{"title":"Image elements have explicit `width` and `height`","description":"Set an explicit width and height on image elements to reduce layout shifts and improve CLS. [Learn how to set image dimensions](https:\/\/web.dev\/optimize-cls\/#images-without-dimensions)","score":1,"displayValue":null,"details":[],"type":["CLS"],"instructions":"<p>To fix this audit, simply specify, both, the width and height for your webpage's image and video elements. This ensures that the correct spacing is used for images and videos.<\/p>\n\t\t\t\t\t\t<p>For example:<\/p>\n\t\t\t\t\t\t<code><img src="image.jpg" width="640" height="360" alt="image"><\/code>\n\t\t\t\t\t\t<p>Where width and height have been declared as 640 and 360 pixels respectively.<\/p>\n\t\t\t\t\t\t<p>Note that modern browsers automatically calculate the aspect ratio for an image\/video based on the declared width and height attributes.<\/p>"},"viewport":{"title":"Has a `<meta name=\"viewport\">` tag with `width` or `initial-scale`","description":"A `<meta name=\"viewport\">` not only optimizes your app for mobile screen sizes, but also prevents [a 300 millisecond delay to user input](https:\/\/developer.chrome.com\/blog\/300ms-tap-delay-gone-away\/). [Learn more about using the viewport meta tag](https:\/\/developer.chrome.com\/docs\/lighthouse\/pwa\/viewport\/).","score":1,"displayValue":null,"details":null,"type":["TBT"],"instructions":"<p>Use the "viewport" <meta> tag to control the viewport's size and shape form mobile friendly website:<\/p>\n\t\t\t\t\t\t<code><meta name="viewport" content="width=device-width, initial-scale=1"><\/code>\n\t\t\t\t\t\t<p>More details <a target=\"_blank\" href=\"https:\/\/developer.mozilla.org\/en-US\/docs\/Web\/HTML\/Viewport_meta_tag\">here<\/a>.<\/p>"}},"diagnostics":{"font-display":{"title":"All text remains visible during webfont loads","description":"Leverage the `font-display` CSS feature to ensure text is user-visible while webfonts are loading. [Learn more about `font-display`](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/font-display\/).","score":1,"displayValue":null,"details":[],"type":["FCP","LCP"],"instructions":"<p>It's advisable to host the fonts on the server instead of using Google CDN<\/p>\n\t\t\t\t\t\t<p>Preload fonts with a plugin or manually:<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<code><link rel="preload" target="_blank" href="\/webfontname" as="font" type="font\/format" crossorigin><\/code>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Use font-display atribute: The font-display attribute determines how the font is displayed during your page load, based on whether it has been downloaded and is ready for use.<\/p>"},"first-contentful-paint-3g":{"title":null,"description":null,"score":null,"displayValue":null,"details":null,"instructions":"<p>Enable Page Cache using the fastest engine.<\/p>\n\t\t\t\t\t\t<p>What it represents: How much is visible at a time during load.<\/p>\n\t\t\t\t\t\t<p>Lighthouse Performance score weighting: 10%<\/p>\n\t\t\t\t\t\t<p>What it measures: The Speed Index is the average time at which visible parts of the page are displayed.<\/p>\n\t\t\t\t\t\t<p>How it's measured: Lighthouse's Speed Index measurement comes from a node module called Speedline.<\/p>\n\t\t\t\t\t\t<p>In order for content to be displayed to the user, the browser must first download, parse, and process all external stylesheets it encounters before it can display or render any content to a user's screen.<\/p>\n\t\t\t\t\t\t<p>The fastest way to bypass the delay of external resources is to use in-line styles for above-the-fold content.<\/p>"},"uses-long-cache-ttl":{"title":"Serve static assets with an efficient cache policy","description":"A long cache lifetime can speed up repeat visits to your page. [Learn more about efficient cache policies](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-long-cache-ttl\/).","score":0.42,"displayValue":"4 resources found","details":[{"cacheLifetimeMs":0,"cacheHitProbability":0,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/peepso-core\/assets\/icons\/fa-solid-900.woff2","wastedBytes":125322,"totalBytes":125322},{"wastedBytes":16939,"totalBytes":16939,"cacheLifetimeMs":0,"cacheHitProbability":0,"url":"https:\/\/actcentive.com\/wp-content\/plugins\/easy-social-share-buttons3\/assets\/fonts\/essb.woff"},{"url":"https:\/\/actcentive.com\/wp-content\/fonts\/montserrat\/JTUHjIg1_i6t8kCHKm4532VJOt5-QNFgpCtr6Hw5aXx-p7K4GLs.woff","wastedBytes":16823,"cacheHitProbability":0,"cacheLifetimeMs":0,"totalBytes":16823},{"wastedBytes":7323,"cacheLifetimeMs":0,"url":"https:\/\/actcentive.com\/wp-content\/themes\/flatsome\/assets\/css\/icons\/fl-icons.woff2?v=3.17.0","totalBytes":7323,"cacheHitProbability":0}],"instructions":"<p>Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#browser_cache\" alt=\"Browser Cache\">Browser Caching<\/a> in W3 Total Cache and set the Expires header and cache control header for static files and HTML.<\/p>\n\t\t\t\t\t\t<p>Use default values for best results<\/p>"},"critical-request-chains":{"title":"Avoid chaining critical requests","description":"The Critical Request Chains below show you what resources are loaded with a high priority. Consider reducing the length of chains, reducing the download size of resources, or deferring the download of unnecessary resources to improve page load. [Learn how to avoid chaining critical requests](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/critical-request-chains\/).","score":null,"displayValue":"39 chains found","details":null,"type":["FCP","LCP"],"instructions":"<p>Eliminate Render Blocking CSS and apply asynchronous loading where applicable. Additionally, image optimization by way of resizing, lazy loaidng, and webp conversion can impact this metric as well.<\/p>"},"resource-summary":{"title":"Keep request counts low and transfer sizes small","description":"To set budgets for the quantity and size of page resources, add a budget.json file. [Learn more about performance budgets](https:\/\/web.dev\/use-lighthouse-for-performance-budgets\/).","score":null,"displayValue":"56 requests \u2022 1,504 KiB","details":[{"resourceType":"total","transferSize":1539606,"label":"Total","requestCount":56},{"requestCount":5,"resourceType":"script","label":"Script","transferSize":818754},{"resourceType":"stylesheet","requestCount":37,"transferSize":277658,"label":"Stylesheet"},{"label":"Image","transferSize":180742,"requestCount":4,"resourceType":"image"},{"resourceType":"font","label":"Font","requestCount":4,"transferSize":166407},{"transferSize":58052,"requestCount":5,"label":"Other","resourceType":"other"},{"transferSize":37993,"label":"Document","resourceType":"document","requestCount":1},{"transferSize":0,"resourceType":"media","requestCount":0,"label":"Media"},{"resourceType":"third-party","transferSize":0,"label":"Third-party","requestCount":0}],"instructions":"<p>Actions that can help:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Avoid multiple page redirects.<\/li>\n\t\t\t\t\t\t\t<li>Combine images using CSS sprites.<\/li>\n\t\t\t\t\t\t\t<li>Remove unnecessary third-party scripts.<\/li>\n\t\t\t\t\t\t\t<li>Compress your text resources.<\/li>\n\t\t\t\t\t\t<\/ul>"},"largest-contentful-paint-element":{"title":"Largest Contentful Paint element","description":"This is the largest contentful element painted within the viewport. [Learn more about the Largest Contentful Paint element](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/lighthouse-largest-contentful-paint\/)","score":null,"displayValue":"1 element found","details":[{"headings":[{"key":"node","valueType":"node","label":"Element"}],"items":[{"node":{"nodeLabel":"Get Connected!\nCome and join our Actcentive community. Expand your network and \u2026","selector":"div.ps-page > div.ps-landing > div.ps-lading__inner > div.ps-landing__cover","snippet":"<div class=\"ps-landing__cover\" style=\"background-image: url("\/wp-content\/plugins\/peepso-core\/assets\/images\/landin\u2026");\">","lhId":"page-0-DIV","type":"node","boundingRect":{"height":393,"right":1335,"left":353,"bottom":639,"width":983,"top":246},"path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,0,DIV"}}],"type":"table"}],"type":["LCP"],"instructions":"<p>How To Fix Poor LCP<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is slow server response time:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Optimize your server.<\/li>\n\t\t\t\t\t\t\t<li>Route users to a nearby CDN.<\/li>\n\t\t\t\t\t\t\t<li>Cache assets.<\/li>\n\t\t\t\t\t\t\t<li>Serve HTML pages cache-first.<\/li>\n\t\t\t\t\t\t\t<li>Establish third-party connections early.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is render-blocking JavaScript and CSS:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Minify CSS.<\/li>\n\t\t\t\t\t\t\t<li>Defer non-critical CSS.<\/li>\n\t\t\t\t\t\t\t<li>Inline critical CSS.<\/li>\n\t\t\t\t\t\t\t<li>Minify and compress JavaScript files.<\/li>\n\t\t\t\t\t\t\t<li>Defer unused JavaScript.<\/li>\n\t\t\t\t\t\t\t<li>Minimize unused polyfills.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is resource load times:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Optimize and compress images.<\/li>\n\t\t\t\t\t\t\t<li>Preload important resources.<\/li>\n\t\t\t\t\t\t\t<li>Compress text files.<\/li>\n\t\t\t\t\t\t\t<li>Deliver different assets based on the network connection (adaptive serving).<\/li>\n\t\t\t\t\t\t\t<li>Cache assets using a service worker.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>If the cause is client-side rendering:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Minimize critical JavaScript.<\/li>\n\t\t\t\t\t\t\t<li>Use another rendering strategy.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>W3 Total Cache Features that will help performace of the above:<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#minify\" alt=\"Minify\">Minify<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#page_cache\" alt=\"Page Cache\">Page Cache<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#browser_cache\" alt=\"Browser Cache\">Browser Cache<\/a><\/li>\n\t\t\t\t\t\t\t<li><a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a><\/li>\n\t\t\t\t\t\t<\/ul>"},"layout-shift-elements":{"title":"Avoid large layout shifts","description":"These DOM elements contribute most to the CLS of the page. [Learn how to improve CLS](https:\/\/web.dev\/optimize-cls\/)","score":null,"displayValue":"1 element found","details":[{"node":{"type":"node","lhId":"page-1-DIV","selector":"main#main > div.page-wrapper > div.row > div#content","path":"1,HTML,1,BODY,10,DIV,1,MAIN,0,DIV,0,DIV,0,DIV","boundingRect":{"top":183,"bottom":1158,"height":975,"right":1350,"width":1013,"left":338},"nodeLabel":"RECENT ACTIVITY\nGet Connected!\nCome and join our Actcentive community. Expand y\u2026","snippet":"<div id=\"content\" class=\"large-9 right col\" role=\"main\">"},"score":0.21643858239938124}],"type":["CLS"],"instructions":"<p>Without completely redesigning your web page from scratch, typically you cannot resolve this warning.  Understand that this warning is significant and if you get it for more than one or two pages in your site, you should consider:<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reducing the amount of widgets \/ sections within your web pages or page layouts<\/li>\n\t\t\t\t\t\t\t<li>Using a simpler web page builder as many page builders add a lot of code bloat<\/li>\n\t\t\t\t\t\t\t<li>Using a different theme<\/li>\n\t\t\t\t\t\t\t<li>Using a different slider<\/li>\n\t\t\t\t\t\t<\/ul>"},"long-tasks":{"title":"Avoid long main-thread tasks","description":"Lists the longest tasks on the main thread, useful for identifying worst contributors to input delay. [Learn how to avoid long main-thread tasks](https:\/\/web.dev\/long-tasks-devtools\/)","score":null,"displayValue":"1 long task found","details":[{"startTime":4360,"duration":107,"url":"https:\/\/actcentive.com\/wp-includes\/js\/zxcvbn.min.js"}],"type":["TBT"],"instructions":"<p>Optimizing third-party JavaScript<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Review your website's third-party code and remove the ones that aren't adding any value to your website.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Debouncing your input handlers<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Debouncing your input handlers helps solve both of the above problems.<\/p>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Delay 3rd-party JS<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reducing JavaScript execution time<\/li>\n\t\t\t\t\t\t\t<li>Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#js\" alt=\"Minify JS\">Minify for JS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Only using compositor properties<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Reducing CSS parsing time<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use W3 Total Cache <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_minify#css\" alt=\"Minify CSS\">Minify for CSS<\/a> and compression.) Use <a target=\"_blank\" href=\"https:\/\/actcentive.com\/wp-admin\/admin.php?page=w3tc_general#cdn\" alt=\"CDN\">CDN<\/a> and HTTP2 Push if available on server.<\/li>\n\t\t\t\t\t\t<\/ul>\n\t\t\t\t\t\t<br\/>\n\t\t\t\t\t\t<p>Only using compositor properties<\/p>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.<\/li>\n\t\t\t\t\t\t<\/ul>"}}},"test_url":"https:\/\/www.googleapis.com\/pagespeedonline\/v5\/runPagespeed?url=https%3A%2F%2Factcentive.com%2F","time":1685453165,"display_time":"May 30th, 2023 1:26pm"}";s:17:"mycred-cache-keys";s:60:"a:1:{i:0;s:42:"log-query-f0c01767e71